import React from 'react'
import "./NavB"

function navBar() {
    return (
        <div className="NavBar">
            <img className="logo" src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Netflix_2015_logo.svg/1920px-Netflix_2015_logo.svg.png" alt="Netflix" />
            <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.clevelanddentalhc.com%2Fstaff%2Fsample-avatar%2F&psig=AOvVaw3IDUUxf1i6cu-eqgVT5nnI&ust=1636467419346000&source=images&cd=vfe&ved=0CAsQjRxqFwoTCOj8_K_6iPQCFQAAAAAdAAAAABAD" alt="" />
        </div>
    )
}

export default navBar
